Text:
Vamos a ir despacio.

@GooglePlay es la tienda más usada en El Salvador, por lo que la abriremos por partes y así no saturar los servidores.

@chivowallet ya está disponible en @GooglePlay, pero únicamente para todas las versiones del Samsung Galaxy S20 y del Samsung Galaxy S21.

